CREATE DEFINER=`root`@`localhost` PROCEDURE `docvis`(
	IN `span` VARCHAR(512), 
	IN `id` INT, 
	IN `alias` varchar(50),
	IN `me` INT
)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DROP TEMPORARY TABLE IF EXISTS doc;
	CREATE TEMPORARY TABLE doc (
		iwho varchar(100),
		iid integer,
		visit date,
		me smallint,
		selse smallint,
		connected smallint	
	);

	Select iwho, iid, max(date(a.created_at)), 0, 0, 0 from activity a
	where a.oref = alias
	and date(a.created_at) between curdate() - interval span day and curdate()
	and a.ipredicate = 'physician'
	group by a.iwho;

	update doc
	set connected = 1
	where iid in (select Follower from connections c join users_metadata m 
					where c.Follower = m.user_id and m.alias = alias);
	
	update doc
	set me = 1
	where iid in (select doc_id from doc_perms where visitor_id = me);

	update doc
	set selse = 1
	where iid in (select doc_id from doc_perms where visitor_id <> me and doc_id is not null);

	Select * from doc;

	DROP TEMPORARY TABLE IF EXISTS doc;

END$$

