DROP PROCEDURE IF EXISTS `sp_recommended_hospitals`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_recommended_hospitals`(IN `userId` INT)
BEGIN
DECLARE dist int DEFAULT (100);
declare mylon_home double;
declare mylat_home double;
declare lon1_home float;
declare lon2_home float;
declare lat1_home float;
declare lat2_home float;
declare zip_home varchar(5);
declare mylon_desired double;
declare mylat_desired double;
declare lon1_desired float;
declare lon2_desired float;
declare lat1_desired float;
declare lat2_desired float;
declare zip_desired varchar(5);
select `Lng`, `Lat`, `ZipCode` into mylon_home, mylat_home, zip_home from zipcodes where `ZipCode` = (SELECT um.zip FROM users_metadata um WHERE um.user_id = userId) limit 1;

set lon1_home = mylon_home-dist/abs(cos(radians(mylat_home))*69);

set lon2_home = mylon_home+dist/abs(cos(radians(mylat_home))*69);

set lat1_home = mylat_home - (dist/69);

set lat2_home = mylat_home + (dist/69);


select `Lng`, `Lat`, `ZipCode` into mylon_desired, mylat_desired, zip_desired from zipcodes where `ZipCode` = (SELECT p.Des_Wk_Zip FROM physician p where p.id = userId) limit 1;

set lon1_desired = mylon_desired-dist/abs(cos(radians(mylat_desired))*69);

set lon2_desired = mylon_desired+dist/abs(cos(radians(mylat_desired))*69);

set lat1_desired = mylat_desired - (dist/69);

set lat2_desired = mylat_desired + (dist/69);

select j.created_at date_posted, j.position job_title, j.hname, j.location, h.alias, j.hospid id from hospitals h, jobs_edw j where h.id in (Select dest.id FROM hospitals dest, zipcodes orig Where (orig.ZipCode = zip_home) AND dest.lng between lon1_home and lon2_home and dest.lat between lat1_home and lat2_home and ( (	3956 * 2 * ASIN(SQRT(POWER(SIN((orig.lat - dest.lat) * pi()/180/2),2) +	COS(orig.lat * pi()/180) * COS(dest.lat * pi()/180) * POWER(SIN((orig.lng - dest.lng) * pi()/180/2), 2) )))< dist) union Select dest.id FROM hospitals dest, zipcodes orig Where (orig.ZipCode = zip_desired) AND dest.lng between lon1_desired and lon2_desired and dest.lat between lat1_desired and lat2_desired and ((3956 * 2 * ASIN(SQRT(POWER(SIN((orig.lat - dest.lat) * pi()/180/2),2) +	COS(orig.lat * pi()/180) * COS(dest.lat * pi()/180) * POWER(SIN((orig.lng - dest.lng) * pi()/180/2), 2) ))) < dist) and h.id = j.hospid);
END$$

