INSERT INTO `jobs_edw` (`JobID`, `Source`, `Position`, `Location`, `Date`, `HName`, `CPara`, `CPara_Clean`, `LPara`, `LPara_Clean`, `Contact_Name`, `Contact_Phone`, `Contact_TollFree`, `Contact_Email`, `hospid`, `filled`, `Created_at`, `publish`, `admin_notes`) VALUES
('1003', 'http://www.teamhealth.com', 'Staff Physician', 'Greeneville, TN', '2013-09-09', 'Laughlin Memorial Hospital', 'Opportunity for a Physician to join our ED team full-time at Laughlin Memorial Hospital in Greeneville, Tennessee.', '<p>\r\n	Opportunity for a Physician to join our ED team full-time at Laughlin Memorial Hospital in Greeneville, Tennessee.</p>\r\n', 'Greeneville is a small, rural town located in northeast Tennessee. This area has a rich, historical background, and Greeneville was the home of Davy Crockett and President Andrew Johnson.', '<p>\r\n	Greeneville is a small, rural town located in northeast Tennessee. This area has a rich, historical background, and Greeneville was the home of Davy Crockett and President Andrew Johnson.</p>\r\n', 'Lisa Murray ', '(865) 985-7178', '', 'lisa_murray@teamhealth.com', 1, NULL, '2013-06-23', 1, ''),
('1008', 'http://www.teamhealth.com', 'Staff Physician', 'Pendleton, OR', '2013-09-03', 'St. Anthony Hospital', 'Opportunity for a Physician''s to join our ED team full-time at St. Anthony Hospital in Pendleton, Oregon. This Level III trauma center will be moving into a brand new facility in November 2013. The ED sees an annual patient volume of 13,000 with an admit rate of 25 to 30 percent, and will be using Meditech/CPOE when they move to the new facility.', '<p>\r\n	Opportunity for a Physician to join our ED team full-time at St. Anthony Hospital in Pendleton, Oregon. This Level III trauma center will be moving into a brand new facility in November 2013. The ED sees an annual patient volume of 13,000 with an admit rate of 25 to 30 percent, and will be using Meditech/CPOE when they move to the new facility.</p>\r\n', 'One of eastern Oregonâ€™s largest cities, Pendleton has a quaint downtown replete with antique stores and home-grown businesses and is home to famous Pendleton Woolen Mills. Situated along the Umatilla River, Pendleton is at the crossroads of American history from its early days as a stop along the Oregon Trail to todayâ€™s Pendleton Round-Up, one the largest and oldest rodeos in the world. Pendleton celebrates a rich history and anticipates a bright future.', '', 'Lynn Benson ', '(253) 838-6180', '(800) 336-8614', 'lynn_benson@teamhealth.com', 2, NULL, '2013-06-24', 1, 'adasd''s'),
('1014', 'http://www.teamhealth.com', 'Staff Physician', 'Lawton, OK', '0000-00-00', 'Comanche County Memorial Hospital', 'Opportunity for a Physician to join our ED team and the faculty of our new Emergency Medicine residency program at Comanche County Memorial Hospital in Lawton, Oklahoma. We are searching for talented physicians of all ranks who are Emergency Medicine residency trained. These physicians will work clinically in the ED as well as serve in faculty roles for the new Emergency Medicine residency program.', '<p>\r\n	Opportunity for a Physician to join our ED team and the faculty of our new Emergency Medicine residency program at Comanche County Memorial Hospital in Lawton, Oklahoma. We are searching for talented physicians of all ranks who are Emergency Medicine residency trained. These physicians will work clinically in the ED as well as serve in faculty roles for the new Emergency Medicine residency program.</p>\r\n', 'Lawtonâ€™s rich history began on August 6, 1901, when the Kiowa-Comanche reservation was opened for settlement. A lottery was used to distribute the land. A person wanting a claim â€“ which was 160 acres in the new section â€“ had to register for a drawing. Experience the history of the Lawton Fort Sill community by visiting the Red River Trading Post, located at the Museum of the Great Plains, during their Spring and Fall Encampments. You will feel as though you have traveled back', '', 'Larry Wills ', '(925) 924-1600', '(800) 617-7717', 'larry_wills@teamhealth.com', 3, NULL, '2013-06-25', 1, ''),
('1050', 'http://www.teamhealth.com', 'Staff Physician', 'BigBearLake, CA', '0000-00-00', 'Bear Valley Community Hospital', 'Opportunity for a Physician to join our ED team part-time at Bear Valley Community Hospital in Big Bear Lake, California. This 5-bed ED sees 9,500 patients annually and provides physician coverage in 24-hour shifts and advanced practice clinician coverage during the busy season. Qualified candidates will be ABEM or AOBEM certified with ATLS and PALS certifications. We offer paid professional liability insurance with tail coverage and more.', '<p>\r\n	Opportunity for a Physician to join our ED team part-time at Bear Valley Community Hospital in Big Bear Lake, California. This 5-bed ED sees 9,500 patients annually and provides physician coverage in 24-hour shifts and advanced practice clinician coverage during the busy season. Qualified candidates will be ABEM or AOBEM certified with ATLS and PALS certifications. We offer paid professional liability insurance with tail coverage and more.</p>\r\n', 'Approximately 115 miles from Los Angeles, 60 miles East of Ontario Airport, and 40 miles from Loma Linda, youâ€™ll find Big Bear Lake. Sitting high above everyday life at an elevation of 7,000 feet in a world of natural beauty and crisp, clean alpine air, this mountain town is well known for its various recreational opportunities like snow and water skiing, fishing, hiking, camping, mountain biking, horseback riding, golfing, varied winter sports, and much more.', '<p>\r\n	Approximately 115 miles from Los Angeles, 60 miles East of Ontario Airport, and 40 miles from Loma Linda, you&#39;ll find Big Bear Lake. Sitting high above everyday life at an elevation of 7,000 feet in a world of natural beauty and crisp, clean alpine air, this mountain town is well known for its various recreational opportunities like snow and water skiing, fishing, hiking, camping, mountain biking, horseback riding, golfing, varied winter sports, and much more.</p>\r\n', 'Andrea Peet ', '(480) 248-6766', '', 'andrea_peet@teamhealth.com', 4, NULL, '2013-06-26', 1, ''),
('1052', 'http://www.teamhealth.com', 'Staff Physician', 'SagamoreHills, OH', '0000-00-00', 'Sagamore Hills Medical Center', 'Opportunity for a Physician to join our ED team part-time at Sagamore Hills Medical Center in Sagamore Hills, Ohio. This facility is a free-standing ED and a satellite of South Pointe Hospital, part of the Cleveland Clinic Health System. The ED sees an annual patient volume of 10,000. Qualified candidates must be  ABEM or AOBEM certified in Emergency Medicine and have current ACLS certification.', '<p>\r\n	Opportunity for a Physician to join our ED team part-time at Sagamore Hills Medical Center in Sagamore Hills, Ohio. This facility is a free-standing ED and a satellite of South Pointe Hospital, part of the Cleveland Clinic Health System. The ED sees an annual patient volume of 10,000. Qualified candidates must be ABEM or AOBEM certified in Emergency Medicine and have current ACLS certification.</p>\r\n', 'Sagamore Hills residents enjoy countless options for entertainment; sports such as biking, hiking, skiing, golf... to name a few; history such as Lock 34 (or Red Lock), one of 44 locks along the Ohio and Erie Canal that lifted canal boats 395 feet between Cleveland and Akron; the arts; shopping; and amusement parks. Dining opportunities in Sagamore Hills range from the Greatest Burger to 5-star venison. Often, however, many people decide to stop running for a day or two to walk, li', '<p>\r\n	Sagamore Hills residents enjoy countless options for entertainment; sports such as biking, hiking, skiing, golf... to name a few; history such as Lock 34 (or Red Lock), one of 44 locks along the Ohio and Erie Canal that lifted canal boats 395 feet between Cleveland and Akron; the arts; shopping; and amusement parks. Dining opportunities in Sagamore Hills range from the Greatest Burger to 5-star venison. Often, however, many people decide to stop running for a day or two to walk, li</p>\r\n', 'Amanda Duncan ', '(888) 926-0134', '', 'amanda_duncan@teamhealth.com', 5, NULL, '2013-06-27', 1, ''),
('1066', 'http://www.teamhealth.com', 'Staff Physician', 'Greenville, SC', '0000-00-00', 'St. Francis Downtown', 'Opportunity for a physician to join our ED team full- or part-time to work in this 2-hospital system that consists of St. Francis-Downtown and St Francis-Eastside in Greenville, South Carolina. This self-directed group enjoys the full support of hospital administrators, the resources and stability of TeamHealth, and a personal connection to a regionally dedicated team. We offer excellent compensation, paid professional liability insurance', NULL, 'In Greenville, South Carolina, you will discover a unique blend of southern traditions and global influences, gentle rolling hills and beautiful majestic mountains, local businesses and international corporations. Located in the northwest corner of South Carolina, Greenville is conveniently located between Atlanta, Georgia, and Charlotte, North Carolina. Ocean beaches are only a few hours away, and the Blue Ridge Mountains are only a 15-minute drive.', NULL, 'Sherri Golden ', '(954) 377-2910', '(800) 424-3672', 'sherri_golden@teamhealth.com', 6, NULL, '2013-06-28', NULL, ''),
('1067', 'http://www.teamhealth.com', 'Staff Physician', 'Pulaski, TN', '0000-00-00', 'Hillside Hospital', 'Opportunity for a Physician to join our ED team full-time at Hillside Hospital in Pulaski, Tennessee. This 95-bed hospital is just a short drive from Nashville, Brentwood, and Franklin, Tennessee, or from Huntsville, Alabama. The 7-bed ED sees an annual patient volume of 11,500. Physician requirements include residency training and board certified/prepared/eligible in Emergency Medicine, Internal Medicine, Family Medicine, or General Surge', '<p>\r\n	Opportunity for a Physician to join our ED team full-time at Hillside Hospital in Pulaski, Tennessee. This 95-bed hospital is just a short drive from Nashville, Brentwood, and Franklin, Tennessee, or from Huntsville, Alabama. The 7-bed ED sees an annual patient volume of 11,500. Physician requirements include residency training and board certified/prepared/eligible in Emergency Medicine, Internal Medicine, Family Medicine, or General Surge</p>\r\n', 'Pulaski, Tennessee, is strategically located at the intersection of Interstate 65 and U.S. Highway 64 at the heart of the industrial corridor between Nashville, Tennessee, and Huntsville, Alabama. Pulaski has a low cost of living, pleasant climate, and numerous recreation activities.', '', 'Cathy Lee ', '(800) 794-2247', '(866) 599-0067', 'cathy_lee@teamhealth.com', 7, NULL, '2013-06-23', 0, ''),
('1068', 'http://www.teamhealth.com', 'Staff Physician', 'Fayetteville, TN', '0000-00-00', 'Lincoln Medical Center', 'Opportunity for a physician to join our ED Team full-time at Lincoln Medical Center in Fayetteville, Tennessee. This 59-bed, acute-hospital is just 85 miles south of Nashville, and the ED has an annual patient volume of 17,000. Qualifications include ACLS, ATLS and PALS certifications along with experience in an ED of similar volume.', '<p>\r\n	Opportunity for a physician to join our ED Team full-time at Lincoln Medical Center in Fayetteville, Tennessee. This 59-bed, acute-hospital is just 85 miles south of Nashville, and the ED has an annual patient volume of 17,000. Qualifications include ACLS, ATLS and PALS certifications along with experience in an ED of similar volume.</p>\r\n', 'With abundant outdoor activities, an expanding business base, and excellent schools that rank among the top three systems in the state, thereâ€™s no question why Fayetteville has received the Three-Star Award from Tennesseeâ€™s governor for 15 consecutive years. The quality of life is exceptional. Just 25 miles from Huntsville, Alabama, and 84 miles from Nashville, Fayetteville has a strong and diversified economy with many beautiful parks and recreation areas.', '<p>\r\n	With abundant outdoor activities, an expanding business base, and excellent schools that rank among the top three systems in the state, there&acirc;&euro;&trade;s no question why Fayetteville has received the Three-Star Award from Tennessee&acirc;&euro;&trade;s governor for 15 consecutive years. The quality of life is exceptional. Just 25 miles from Huntsville, Alabama, and 84 miles from Nashville, Fayetteville has a strong and diversified economy with many beautiful parks and recreation areas.</p>\r\n', 'Cathy Lee ', '(800) 794-2247', '(866) 599-0067', 'cathy_lee@teamhealth.com', 8, NULL, '2013-06-25', 1, ''),
('1076', 'http://www.teamhealth.com', 'Staff Physician', 'Harvey, IL', '0000-00-00', 'Ingalls Memorial Hospital', 'Opportunity for a Physician to join our ED team full-time at Ingalls Memorial Hospital in Harvey, Illinois. This facility serves Chicago''s South Suburbs and supports a 15-bed ED and 14-bed fast track that see an annual patient volume of 43,000. This is an employee position and comes with a comprehensive benefits package. If you are board certified in Emergency Medicine and are looking to join a superb group of ED physicians, submit your CV', NULL, 'The city of Harvey, Illinois, lies in the heart of Chicago''s Southland and is only 30 minutes from downtown Chicago. More than 15 parks offer basketball, picnic areas, and recreational facilities, and Harvey is home to many professional athletes and offers numerous facilities and recreational areas to support athletic events.', NULL, 'Trisha Miller ', '(865) 560-8415', '(855) 276-0002', 'trisha_miller@teamhealth.com', 9, NULL, '2013-06-23', NULL, ''),
('1086', 'http://www.teamhealth.com', 'Staff Physician', 'Harriman, TN', '0000-00-00', 'Roane Medical Center', 'Opportunity for a Physician to join our ED team full-time at Roane Medical Center in Harriman, Tennessee.', '<p>\r\n	Opportunity for a Doc to join our ED team full-time at Roane Medical Center in Harriman, Tennessee.</p>\r\n', 'Located at Big Emory Gap in Roane County, Tennessee, Harriman has the advantages of a modern urban community with a small hometown atmosphere. Here you can enjoy access to quality shopping in many larger cities surrounding Harriman and the recreational activities offered by the Appalachian Mountains of East Tennessee, the Tennessee River valley, and local lakes.', '<p>\r\n	Located at Big Emory Gap in Roane County, Tennessee, Harriman has the advantages of a modern urban community with a small hometown atmosphere. Here you can enjoy access to quality shopping in many larger cities surrounding Harriman and the recreational activities offered by the Appalachian Mountains of East Tennessee, the Tennessee River valley, and local lakes.</p>\r\n', 'Lisa Murray ', '(865) 985-7178', '', 'lisa_murray@teamhealth.com', 10, NULL, '2013-06-23', 1, 'test notes'),
('1089', 'http://www.teamhealth.com', 'Staff Physician', 'Morristown, TN', '0000-00-00', 'Morristown-Hamblen Hospital', 'Opportunity for a Physician to join our ED team full-time at Morristown-Hamblen Hospital in Morristown, Tennessee. This 167-bed hospital supports a 19-bed ED, 12 Centers of Excellence, a Surgical Services Center, a 4-bed in-patient dialysis program; advanced technology and imaging, excellent Heart, Lung, Vascular Services including an Interventional Cardiac Services, Regional Cancer Center, and Mobile Crisis and Psychiatric Services.', NULL, 'Located in the lush, fertile valley between the Great Smoky Mountains and the rugged Clinch Mountains in East Tennessee, Morristown is surrounded by lakes, rolling hills, mountains, and natural history. There are many ways to enjoy the scenery. You can hike, swim or enjoy the playgrounds at Panther Creek State Park and Cherokee Park. In just an hour''s drive, you can experience the Blue Ridge Parkway or another beautiful and interesting locale in any direction.', NULL, 'Lisa Murray ', '(865) 985-7178', '', 'lisa_murray@teamhealth.com', 11, NULL, '2013-06-23', NULL, ''),
('1092', 'http://www.teamhealth.com', 'Staff Physician', 'Pasco, WA', '0000-00-00', 'Lourdes Medical Center', 'Opportunity for a Physician to join our ED Team full-time at Lourdes Medical Center in Pasco, Washington. This Level IV trauma Center supports a 23,000-volume ED that see patients with fairly low acuity. The ED is staffed with two 12- hour physician shifts and one 12-hour advanced practice clinician shift daily. The ED has 12 beds, 10 in their own private spaces, and utilizes a T-system template system. We are seeking an emergency medicine', NULL, 'Pasco, Washington, is located at the confluence of the Columbia, Yakima, and Snake Rivers. Great weather and the inviting waterways enable residents and visitors to enjoy a multitude of outdoor activities such as water sports, golf, wine tours, and outdoor theater.', NULL, 'Lynn Benson ', '(253) 838-6180', '(800) 336-8614', 'lynn_benson@teamhealth.com', 18, NULL, '2013-06-23', NULL, '');
